// src/App.js
import React from 'react';
import Honeycomb from './honeycomb';
import './App.css'; // Add this if you need to style your app

const data = [
  { difficulty: 'easy', count: 10, color: '#4CAF50' },
  { difficulty: 'medium', count: 5, color: '#FFEB3B' },
  { difficulty: 'hard', count: 3, color: '#F44336' },
];

function App() {
  return (
    <div className="App">
      <h1>Question Difficulty Honeycomb</h1>
      <Honeycomb data={data} />
    </div>
  );
}

export default App;
